// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

contract RewardCity is IERC20, Ownable, Pausable, ReentrancyGuard {
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    uint256 private _totalSupply;
    uint256 private constant _maxSupply = 1000000 * 10 ** 18; // Limite de fornecimento (opcional)
    address private _treasury; // Endereço para taxas de transação (se aplicável)
    uint256 private _transactionFee = 10; // Taxa em basis points (0.1%)

    event TokensMinted(address indexed to, uint256 amount);
    event TokensBurned(address indexed from, uint256 amount);
    event TransactionFeeUpdated(uint256 newFee);
    event TreasuryUpdated(address newTreasury);

constructor(address initialOwner) Ownable(initialOwner) {
        _totalSupply = 100000 * 10 ** decimals();
        _balances[initialOwner] = _totalSupply;
    }


    function name() public pure returns (string memory) {
        return "RewardCity";
    }

    function symbol() public pure returns (string memory) {
        return "RWCT";
    }

    function decimals() public pure returns (uint8) {
        return 18;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public override whenNotPaused nonReentrant returns (bool) {
        uint256 fee = (amount * _transactionFee) / 1000;
        uint256 amountAfterFee = amount - fee;

        require(_balances[msg.sender] >= amount, "Insufficient balance");
        require(recipient != address(0), "Invalid recipient address");

        _balances[msg.sender] -= amount;
        _balances[recipient] += amountAfterFee;
        _balances[_treasury] += fee;

        emit Transfer(msg.sender, recipient, amountAfterFee);
        emit Transfer(msg.sender, _treasury, fee);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override whenNotPaused nonReentrant returns (bool) {
        require(_allowances[sender][msg.sender] >= amount, "Insufficient allowance");
        require(_balances[sender] >= amount, "Insufficient balance");
        require(recipient != address(0), "Invalid recipient address");

        uint256 fee = (amount * _transactionFee) / 1000;
        uint256 amountAfterFee = amount - fee;

        _balances[sender] -= amount;
        _balances[recipient] += amountAfterFee;
        _balances[_treasury] += fee;
        _allowances[sender][msg.sender] -= amount;

        emit Transfer(sender, recipient, amountAfterFee);
        emit Transfer(sender, _treasury, fee);
        return true;
    }

    function burn(uint256 amount) public {
        require(_balances[msg.sender] >= amount, "Insufficient balance to burn");
        _balances[msg.sender] -= amount;
        _totalSupply -= amount;
        emit TokensBurned(msg.sender, amount);
        emit Transfer(msg.sender, address(0), amount);
    }

    function mint(address to, uint256 amount) public onlyOwner {
        require(_totalSupply + amount <= _maxSupply, "Exceeds max supply");
        _totalSupply += amount;
        _balances[to] += amount;
        emit TokensMinted(to, amount);
        emit Transfer(address(0), to, amount);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function setTransactionFee(uint256 fee) public onlyOwner {
        require(fee <= 50, "Fee too high"); // Máximo de 5%
        _transactionFee = fee;
        emit TransactionFeeUpdated(fee);
    }

    function treasury() public view returns (address) {
        return _treasury;
    }

    function updateTreasury(address newTreasury) public onlyOwner {
        require(newTreasury != address(0), "Invalid treasury address");
        _treasury = newTreasury;
        emit TreasuryUpdated(newTreasury);
    }
}

